import { Link } from "react-router-dom";
import React, { useState } from "react";
import $ from "jquery";
import "meanmenu/jquery.meanmenu";

const Navbar = () => {
  useEffect(() => {
    // Initialize the meanmenu plugin
    $("nav#nav").meanmenu({
      meanMenuContainer: "#navbarSupportedContent", // selector of the element to insert meanmenu into
      meanScreenWidth: "991", // breakpoint for menu to become responsive
    });

    // Clean up the meanmenu instance when component unmounts
    return () => {
      $("nav#nav").meanmenu("destroy");
    };
  }, []);

  return (
    <div className="navbar-area two fixed-top">
      {/* Menu For Mobile Device */}
      <div className="mobile-nav">
        <Link to="/" className="logo">
          <img
            src={`${process.env.PUBLIC_URL}/assets/img/logo.png`}
            alt="Logo"
          />
        </Link>
        <button
          className="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
      </div>

      {/* Menu For Desktop Device */}
      <div className="main-nav">
        <div className="container">
          <nav className="navbar navbar-expand-md navbar-light">
            <Link to="/" className="navbar-brand">
              <img
                src={`${process.env.PUBLIC_URL}/assets/img/logo.png`}
                alt="Logo"
              />
            </Link>
            <div
              className={`${isNavCollapsed ? "collapse" : ""} navbar-collapse`}
              id="navbarSupportedContent"
            >
              <ul className="navbar-nav">
                <li className="nav-item">
                  <Link to="/" className="nav-link active">
                    Home
                  </Link>
                </li>
                <li className="nav-item">
                  <Link to="/about" className="nav-link">
                    About
                  </Link>
                </li>
                <li className="nav-item">
                  <Link to="#" className="nav-link">
                    Services
                  </Link>
                  {/* Dropdown menu example */}
                </li>
                <li className="nav-item">
                  <Link to="#">Projects</Link>
                </li>
                <li className="nav-item">
                  <Link to="/contact" className="nav-link">
                    Contact
                  </Link>
                </li>
              </ul>
              <div className="side-nav">
                <Link to="#">Book A Schedule</Link>
              </div>
            </div>
          </nav>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
